import React from 'react';
import Link from "next/link";

const NavItem: React.FC<{[key:string]: string}> = ({title, url}) => {
    return (
        <li>
            <Link href={url}><a>{title}</a></Link>
            <style jsx>{`
                li {
                    list-style: none;
                    padding: 20px 1px;
                    border-radius: 3px;
                    border: 1px solid grey;
                }
            `}</style>
        </li>
    )
};

export default NavItem;
